package com.bituos.lca.Beans;

/**
 * @author cirm
*/

public class BeanTestParameter{

	private int id;
	private String name;
	private BeanTest id_test;
	private int active;
	private String measurement_unit;
	private int is_numeric;
	private int is_free_text;
	
	
	
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public BeanTest getId_test() {
		return id_test;
	}
	public void setId_test(BeanTest id_test) {
		this.id_test = id_test;
	}
	public int getActive() {
		return active;
	}
	public void setActive(int active) {
		this.active = active;
	}
	public String getMeasurement_unit() {
		return measurement_unit;
	}
	public void setMeasurement_unit(String measurement_unit) {
		this.measurement_unit = measurement_unit;
	}
	public int getIs_numeric() {
		return is_numeric;
	}
	public void setIs_numeric(int is_numeric) {
		this.is_numeric = is_numeric;
	}
	public int getIs_free_text() {
		return is_free_text;
	}
	public void setIs_free_text(int is_free_text) {
		this.is_free_text = is_free_text;
	}




	
}
